      <tr>
         {
                animes.map( anime =>
                    <div key={anime._id}> 
                      <img src={anime.image} alt={anime.title} />
                        <span>{anime.title} Price: {anime.rating}</span>  
                        <button onClick={()=>{deleteBtnClickHandler(anime._id)}}> x </button>
                        <Link to={'/items/edit/' + anime._id}>
                            <button >Edit Item</button>
                        </Link>
                    </div>
                    )
            }
      </tr>


    )
}

